import React from 'react';
import { Fade } from 'react-slideshow-image';
import "./styles/Slideshow.css";
import "./img";

const fadeImages = [
  'img/brushstroke.png',
  'img/art1.jpg',
  'img/art2.jpg'
];

const fadeProperties = {
  duration: 5000,
  transitionDuration: 500,
  infinite: false,
  indicators: true
}

const Slideshow = () => {
  return (
    <Fade {...fadeProperties}>
      <div className="each-fade">
        <div className="image-container">
          <img src={fadeImages[0]} alt="brushstroke"/>
        </div>
        <h2>First Slide</h2>
      </div>
      <div className="each-fade">
        <div className="image-container">
          <img src={fadeImages[1]} alt="art1" />
        </div>
        <h2>Second Slide</h2>
      </div>
      <div className="each-fade">
        <div className="image-container">
          <img src={fadeImages[2]} alt="art2"/>
        </div>
        <h2>Third Slide</h2>
      </div>
    </Fade>
  )
}
export default Slideshow;
